import React from "react";
import { Menu } from "antd";
import styled, { createGlobalStyle } from "styled-components";
import {
  SendOutlined,
  HomeOutlined,
  HeartOutlined,
  MessageOutlined,
  SettingOutlined,
} from "@ant-design/icons";
import Link from "next/link";


const MenuMenu = () => {
  return (
    <MenuWrapper theme="light" defaultSelectedKeys={["1"]} mode="inline">

      <Menu.Item key="1" icon={<HomeOutlined />}>
          <Link href='/'>
        대시보드
        </Link>
      </Menu.Item>
      <Menu.Item key="2" icon={<MessageOutlined />}>
      <Link href='/polylineTest'>
        라이딩경로
        </Link>
      </Menu.Item>
      <Menu.Item key="3" icon={<HeartOutlined />}>
          <Link href='/myRecord'>
          경로만들기
          </Link>

      </Menu.Item>
      <Menu.Item key="4" icon={<SendOutlined />}>
        내프로필
      </Menu.Item>
      <Menu.Item key="5" icon={<SettingOutlined />}>
        설정
      </Menu.Item>
    </MenuWrapper>
  );
};

const MenuWrapper = styled(Menu)`
  position: relative;
  top: 0%;
  transition: all 0.2s;
  .ant-menu-item {
    margin: 10px 0;
  }
  border-right: none;
`;

export default MenuMenu;
